class Solution:
    def isIsomorphic(self, s: str, t: str) -> bool:
        mapped = {}
        visited = set()
        for i in range(len(s)):
        #Case1: Check if the current element in 's' present in our dictionary
            if s[i] in mapped:
            #Case 1:  Subcase -  check if the current element is mapped to our memory
                if mapped[s[i]] == t[i]:
                    continue
                else:
                    return False
            #Case 2: If the current element is in visited, return False
            elif t[i] in visited:
                return False
            else:
            #Case 3: If both characters from both the strings are unique, add them to our dictionary and to our visited memory
                mapped[s[i]] = t[i]
                visited.add(t[i])
        return True
